INSERT INTO public.companies (id, company_name, company_link, user_id, company_size, description)
VALUES ('f0d33fa5-e460-44b9-8c08-f9029186ec04', 'Masaryk University', 'muni.cz', '789dc2d2-4c78-4726-94b5-3d2c16b5d250',
        'CORPORATION',
        '<p>Jsme tu již více než 100 let, máme více jak 6500 zaměstnanců, lidé u nás zůstávají průměrně více jak 5 let. Naši zaměstnanci si chválí přátelské prostředí, otevřenost v týmu a pracovní atmosféru. Podporujeme vzdělávání, zahraniční praxe i kariérní růst. Šanci získat zaměstnání má mít u nás každý bez ohledu na věk, pohlaví či sociální nebo jiné znevýhodnění. Studentům umožňujeme získat praxi, absolventům nastartovat jejich kariéru a rodičům skloubit práci a výchovu dětí.</p><p>Máme deset fakult s více než 200 katedrami, ústavy a klinikami, které působí v širokém spektru přírodních i humanitních akademických disciplín a výzkumných oblastí. Věříme, že vzdělávání není jen otázkou věku nebo sociálního postavení. Aktivně podporujeme výzkum. Ovlivňujeme kulturní i společenský život v Brně, rekonstruujeme historické budovy, modernizujeme knihovny a budujeme výzkumná centra. <strong>Víme, že můžeme být úspěšní právě díky našim zaměstnancům. </strong></p><p><br></p><p>Našim zaměstnancům nabízíme skvělé podmínky pro práci …</p><p>6 týdnů dovolené, pro akademiky 8</p><p>Špičkově vybavená pracoviště</p><p>Stravenkový paušál, využití menz a bufetů</p><p>Knihovny zdarma a slevy na kurzy</p><p>Příspěvek na penzijní připojištění </p><p>Příspěvek na očkování</p><p>Multisport karta</p><p>Zvýhodněné tarify u mobilního operátora a další</p>');
INSERT INTO public.companies (id, company_name, company_link, user_id, company_size, description)
VALUES ('a3559698-f659-4faf-85b1-fbe69d07d263', 'Vysoké učení technické v Brně', 'vutbr.jobs.cz',
        'fdbc3724-64b9-4bf2-9f74-1d1d695e7292', 'CORPORATION',
        '<h2>Proč pracovat na VUT?</h2><p>Jsme největší technickou univerzitou v republice a nejstarší vysokou školou v Brně. Od roku 1899, kdy naši existenci posvětil císař František Josef I., máme za sebou hodně práce, zkušeností, a hlavně výsledků. Dnes jsme schopni nabídnout nejen kvalitní vysokoškolské vzdělání, ale výrazně se angažujeme i v oblasti vědy a výzkumu. Naši absolventi nemají problém najít uplatnění na trhu práce, většina z nich navíc vnímá, že bez studia na VUT by jejich aktuální pracovní uplatnění a další pracovní možnosti nebyly zdaleka na takové úrovni. Spektrum oborů, kterým se věnujeme, je velmi pestré. Kromě klasických technických disciplín nabízíme vzdělání i v architektuře, přírodních vědách, ekonomice či výtvarném umění. Založili jsme pět samostatných výzkumných center, jsme také zapojeni do aktivit dvou národních center excelentního výzkumu. Dbáme na to, aby výstupy našich vědců byly prospěšné a přispívaly tak k lepší budoucnosti nás všech.</p>');
