INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('549c74a0-b159-4936-bef4-840dee7ee75d', 'ACTIVE', 'Postdoktorand - piezo-elektrické keramické materiály',
        'Czech Republic', 'Jihomoravský kraj', 'Brno', 'a3559698-f659-4faf-85b1-fbe69d07d263',
        'recruitment.vut@jobportal.application.cz',
        '<h1>Postdoktorand - piezo-elektrické keramické materiály</h1><p><br></p><p><strong>The director of the CEITEC Brno University of Technology is opening a position of a</strong></p><p><br></p><h2><strong>Postdoktorand - Výzkumný pracovník pro přípravu a hodnocení vlastností bezolovnatých piezo-elektrických keramických materiálů</strong></h2><p>Postdoctoral Research Fellow: „ Researcher for the preparation and assessment of the properties of lead-free piezoelectric ceramic materials”</p><p><br></p><p><strong>Description</strong></p><p>Prof. Karel Maca, Group leader at CEITEC, is looking for an experienced materials engineer with skills in ceramics processing and properties and related applications.</p><p>We are looking for a highly motivated researcher with a strong background in ceramic processing and materials.</p><p><br></p><p><strong>Expectations</strong></p><p><br></p><ul><li>Deep knowledge of materials engineering, ceramics processing and chemistry is a must.</li><li>Knowledge of work with state-of-the-art ceramics processing infrastructure.</li><li>Experience with preparation and characterization of lead-free piezoceramic materials is a must.</li><li>Ability to carry out the research projects independently, interpret the data and write manuscripts.</li><li>Excellent team working skills, self-motivation, initiative, and persistence.</li><li>Ability to exploit CEITEC BUT core facilities and laboratories (nano.ceitec.cz).</li><li>Act as a source of information and advice to other members of the group on scientific protocols and experimental techniques.</li></ul><p><br></p><p><strong>We offer</strong></p><p><br></p><ul><li>Fully English-speaking and highly motivated environment.</li><li>Support team members with diverse backgrounds.</li><li>Work in the Czech Science City Brno with many collaboration possibilities.</li><li>Wide international network of collaborators.</li></ul><p><br></p><p> <strong>Interested candidates should provide</strong></p><ul><li>Detailed CV including a list of publications.</li><li>Cover letter stating the motivation, his/her contribution to the field and vision.</li><li>Name and contact details of two academic referees from two distinct institutions.</li></ul><p><br></p><p><strong>Employment Conditions</strong></p><p><br></p><ul><li>Anticipated start date: 1.1.2024.</li><li>Highly competitive salary based on the candidate’s qualifications and experience.</li><li>Work in general science laboratories.</li><li>Part-time job, 6 hours per week.</li><li>6 weeks of holidays.</li><li>Place: CEITEC BUT, Purkyňova 123, Brno, Czech Republic.</li></ul><p><br></p><p>Electronic applications including required items should be submitted to e-mail recruitmen-at-ceitec.vutbr.cz <strong>by December 3rd, 2023 and quote the “Piezoceramics”</strong> in the subject.</p><p><br></p><p><br></p><h2>Kontakt</h2><p><strong>CEITEC VUT - Vysoké učení technické v Brně</strong></p><p>Purkyňova&nbsp;123</p><p>61200&nbsp;&nbsp;Brno 12</p><p>Česká republika</p>',
        '2023-11-26 10:58:51.392724', '2023-11-26 10:58:51.392724');
INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('36909fde-c39f-48ee-87d0-991ae4a59e3c', 'ACTIVE', 'FIT - ODBORNÝ ASISTENT/ASISTENTKA', 'Czech Republic',
        'Jihomoravský kraj', 'Brno', 'a3559698-f659-4faf-85b1-fbe69d07d263', 'recruitment.vut@jobportal.application.cz',
        '<h1>FIT - ODBORNÝ ASISTENT/ASISTENTKA</h1><p><br></p><p>Děkan Fakulty informačních technologií Vysokého učení technického v Brně (dále jen „vyhlašovatel“) vyhlašuje výběrové řízení na obsazení místa akademického pracovníka na pracovní pozici:</p><p><strong>AKADEMICKÝ PRACOVNÍK – ODBORNÝ ASISTENT/ASISTENTKA pro Ústav inteligentních systémů</strong></p><p><strong>Náplň práce:</strong> Výuka, výzkum a vývoj v oblasti bezpečnosti systémů a informační bezpečnosti</p><p><strong>Kvalifikační požadavky:</strong></p><p><br></p><ul><li>Vzdělání Ph.D. v oboru výpočetní technika nebo informatika nebo obdobném relevantním.</li><li>Zkušenosti s výukou na vysoké škole, pedagogické vzdělaní, schopnost přednášet česky a anglicky.</li><li>Dostatečná publikační činnost: alespoň 3 hodnocené publikace (např. s impakt faktorem, Q1 nebo Q2 dle Scopus/WoS).</li><li>Účast alespoň na dvou výzkumných grantových projektech na mezinárodní/národní úrovni, z toho minimálně jeden mezi více institucemi.</li><li>Znalost činnosti v akademické sféře, vedení kvalifikačních prací.</li><li>Odborné znalosti v oblasti bezpečnosti IT.</li></ul><p><strong>Požadovaná forma přihlášky uchazeče:</strong></p><p><br></p><ul><li>strukturovaný životopis,</li><li>kopie dokladů o dosaženém vzdělání (diplom nebo ekvivalent),</li><li>přehled publikační činnosti.</li></ul><p><strong>Nabízíme:</strong></p><p><br></p><ul><li>Smlouvu na dobu určitou s možností prodloužení.</li><li>Zajímavou práci, výzkum a vývoj v oblasti bezpečnosti informačních systémů v instituci oceněné HR Excellence in Research Award.</li><li>Vysoce profesionální tým kolegů, špičkové institucionální zázemí.</li><li>Příspěvek zaměstnavatele na stravování.</li><li>Zaměstnanecké benefity – příspěvek na penzijní připojištění nebo doplňkové penzijní spoření nebo benefitní karta.</li><li>8 týdnů dovolené.</li><li>Bezplatné školení a další vzdělávání.</li><li>Firemní miniškolka Edisonka.</li><li>Rovnováha mezi soukromým a pracovním životem.</li></ul><p><strong>Pracovní úvazek:</strong></p><p><br></p><ul><li>poloviční pracovní úvazek, tj. 20 h/týdně</li></ul><p>Termín pro podání přihlášek je do <strong>21. 12. 2023</strong>.</p><p>Předpokládaný nástup: <strong>1. 1. 2024</strong></p><p>Přihlášky zasílejte elektronicky odpovědí na inzerát, kontaktní osoba: Mgr. Barbora Paulíková, personální oddělení Fakulty informačních technologií, Vysoké učení technické v Brně, Božetěchova 1/2, 612 00 Brno.</p><p>The Dean of the Faculty of Information Technologies of the University of Technology in Brno (hereinafter referred to as the "announcer") announces a hiring procedure for the position of an academic employee:</p><p><strong>ACADEMIC POSITION – ASSISTANT PROFESSOR at the Department of Intelligent Systems</strong></p><p>Job Description: Teaching, research, and development in systems security and information security</p><p><strong>Qualification requirements:</strong></p><p><br></p><ul><li>Ph.D. degree in computing, informatics, or similar.</li><li>Teaching experience at universities, pedagogical education, skills to make lectures in Czech and English.</li><li>Sufficient publication activity: at least 3 ranked journal publications (e.g., impact factor, Q1 or Q2 according to Scopus/WoS).</li><li>Participation in at least two research grant projects at the international/national level, of which at least one involved more than one institution.</li><li>Knowledge of activities in the academic sphere and management of qualification works.</li><li>Expert knowledge in the field of IT security.</li></ul><p><strong>Required form of application:</strong></p><p><br></p><ul><li>structured CV,</li><li>copies of documents proving earned education (diploma or equivalent),</li><li>an overview of publication activity.</li></ul><p><strong>We offer:</strong></p><p><br></p><ul><li>Fixed-term contract with the possibility of extension.</li><li>Interesting work, research in the field of information systems security at an institution with HR Excellence in Research Award.</li><li>Highly professional team of colleagues with top institutional background.</li><li>Subsidised meals in university canteen.</li><li>Employee benefits - contribution towards supplementary pension insurance or additional pension saving schemes or a benefit card.</li><li>8 weeks of leave.</li><li>Free training and further education.</li><li>Company mini-kindergarten (Edisonka).</li><li>Work-life balance.</li></ul><p><strong>Working time:</strong></p><p><br></p><ul><li>part-time work, i.e. 20 h/week</li></ul><p>The deadline for submitting applications is <strong>December 21, 2023</strong>.</p><p>Expected start date: <strong>January 1, 2024</strong></p><p>Applications should be sent electronically by replying to the advertisement, contact person: Mgr. Barbora Paulíková, HR Office, Faculty of Information Technology, Brno University of Technology, Božetěchova 1/2, 612 00 Brno.</p><h2>Kontakt</h2><p><strong>Vysoké učení technické v Brně, Fakulta informačních technologií</strong></p><p>Božetěchova&nbsp;2/1</p><p>612 00&nbsp;&nbsp;Brno</p><p>Česká republika</p><p>tel. +420 541 141 174</p>',
        '2023-11-26 11:01:22.220262', '2023-11-26 11:01:22.220262');
INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('c80be896-ff82-4fff-bb33-6f28e5e64ac1', 'ACTIVE', 'Asistent pro projekt', 'Czech Republic', 'Jihomoravský kraj',
        'Brno', 'a3559698-f659-4faf-85b1-fbe69d07d263', 'recruitment.vut@jobportal.application.cz',
        '<p>Výběrové řízení</p><p>Děkan Fakulty chemické Vysokého učení technického v Brně vyhlašuje výběrové řízení pro Centrum materiálového výzkumu na obsazení pracovní pozice</p><p><strong>ASISTENT PRO PROJEKT „OPTIMALIZACE REGENERAČNÍHO MODULU MEMBRÁN“ V RÁMCI OPERAČNÍHO PROGRAMU TECHNOLOGIE A APLIKACE PRO KONKURENCESCHOPNOST MINISTERSTVA PRŮMYSLU A OBCHODU ČR (číslo projektu: CZ.01.01.01/06/23_014/0001373)</strong></p><p>rozsah úvazku 1,0</p><p><strong>Kvalifikační požadavky:</strong></p><p><br></p><ul><li>vysokoškolské vzdělání se zaměřením na chemii</li><li>znalosti v oboru technologie vody</li><li>vědecký titul Ing.</li><li>zkušenosti s řešením projektů</li><li>schopnost pracovat v týmu, komunikační schopnosti, samostatnost</li></ul><p><strong>Náplň práce:</strong></p><p><br></p><ul><li>aktivní účast při realizaci dílčích úkolů potřebných pro úspěšnou realizaci projektu</li><li>transfer znalostí a dovedností do podniku ASIO TECH, spol. s r.o.</li><li>spolupodílet se na přípravě a publikaci odborných textů</li><li>účastnit se školících a vzdělávacích kurzů pořádaných znalostní organizací (Fakulta chemická)</li></ul><p><strong>Nabízíme:</strong></p><p><br></p><ul><li>moderní pracovní prostředí</li><li>odborný růst na špičkově vybaveném pracovišti</li><li>možnost získat zkušenosti při realizaci projektu</li><li>práce v týmu odborníků zaměřených na technologii vody</li></ul><p><strong>Nástup: 1.1.2024</strong></p><p>K přihlášce přiložte:</p><p><br></p><ul><li>Životopis</li><li>Kopie dokladů o dosaženém VŠ vzdělání</li></ul><p>Bližší informace podá personalistka CMV Mgr. Jana Kopřivová; tel.č. +420 541 149 314</p><p>Přihlášky přijímá personální oddělení FCH VUT v Brně, Purkyňova 464/118, 612 00 Brno, e-mailem, poštou nebo osobním podáním,</p><p><strong>do 30.11.2023</strong>.</p><p>Selection procedure</p><p>The Dean of the Faculty of Chemistry of Brno University of Technology announces a selection procedure for the Centre for Materials Research to fill the position of</p><p><strong>ASSISTANT FOR THE PROJECT "OPTIMIZATION OF THE MEMBRANE REGENERATION MODULE" WITHIN THE OPERATIONAL PROGRAMME TECHNOLOGIES AND APPLICATIONS FOR COMPETITIVENESS OF THE MINISTRY OF INDUSTRY AND TRADE OF THE CZECH REPUBLIC (project number: CZ.01.01.01/06/23_014/0001373)</strong></p><p>range of time: 1,0</p><p>Qualification requirements:</p><p><br></p><ul><li>university degree with a focus on chemistry</li><li>knowledge of water technology</li><li>scientific degree Ing.</li><li>experience in project management</li><li>ability to work in a team, communication skills, independence</li></ul><p>Job description:</p><p><br></p><ul><li>active participation in the implementation of partial tasks necessary for the successful implementation of the project</li><li>transfer of knowledge and skills to ASIO TECH, spol. s r.o.</li><li>participate in the preparation and publication of technical texts</li><li>participate in training and educational courses organised by the knowledge organisation (Faculty of Chemistry)</li></ul><p>We offer:</p><p><br></p><ul><li>modern working environment</li><li>professional growth in a well-equipped workplace</li><li>the opportunity to gain experience in project implementation</li><li>work in a team of experts focused on water technology</li></ul><p>Retrieved from: 1.1.2024</p><p>Please attach to your application:</p><p><br></p><ul><li>CV</li><li>Copy of evidence of higher education</li></ul><p>Applications are accepted by the Human Resources Department of the Brno University of Technology, Purkyňova 464/118, 612 00 Brno, by e-mail, mail or personal submission</p><p><strong>by 30.11.2023</strong></p><h2>Kontakt</h2><p><strong>Vysoké učení technické v Brně</strong></p><p>541149314</p>',
        '2023-11-26 11:06:12.020511', '2023-11-26 11:06:12.020511');
