        'FP -Akademický pracovník - Odborný asistent/odborná asistentka a asistent/ka', 'Czech Republic',
        'Jihomoravský kraj', 'Brno', 'a3559698-f659-4faf-85b1-fbe69d07d263', 'recruitment.vut@jobportal.application.cz',
        '<p>Děkan Fakulty podnikatelské Vysokého učení technického v Brně vyhlašuje výběrové řízení na obsazení míst akademický pracovník na pracovní pozici:</p><p><strong>AKADEMICKÝ PRACOVNÍK – 2 pozice asistent/ka na 0,1 a 0,2 úvazek, 1 pozice odborný asistent/ka na 0,20 úvazek na Ústav ekonomiky na projekt NPO_VUT_MSMT-16609/2022, Transformace formy a obsahu vzdělávání na Vysokém učení technickém v Brně.</strong></p><p><strong>Náplň práce:</strong></p><p><br></p><ul><li>Zajištění odborné činnosti ve vzdělávání v oblasti návrhu a realizace kurzu/vybraného předmětu;</li><li>Tvorba obsahové i metodické části kurzu/předmětu;</li><li>Tvorba dokumentace ke kurzu/předmětu, vč. sylabu;</li><li>Zajištění a garance výuky kurzu/předmětu.</li></ul><p><strong>Kvalifikační požadavky:</strong></p><p><br></p><ul><li>ukončené vysokoškolské vzdělání v odpovídajícím magisterském studijním programu;</li><li>zkušenosti s výukou/lektorskou činností výhodou;</li><li>časovou flexibilitu, samostatnost, zodpovědnost a pečlivost;</li><li>aktivní přístup k práci a ochotu učit se novým věcem;</li><li>zkušenosti s pokročilými způsoby zpracování a analýzy dat;</li><li>znalost anglického jazyka na úrovni, která umožňuje vedení výuky v anglickém jazyce a práci s odbornými anglickými zdroji;</li><li>zahájené či ukončené doktorské studium uchazeče/uchazečky v oblasti ekonomiky.</li></ul><p><strong>Nabízíme:</strong></p><p><br></p><ul><li>stabilita a zázemí veřejné vysoké školy,</li><li>vysoce moderní pracovní prostředí se zajímavou a kreativní prací,</li><li>možnost profesního růstu,</li><li>pružná pracovní doba.</li><li><br></li></ul><p><strong>Předpokládaný nástup: 01.01.2024</strong></p><p><strong>K přihlášce přiložte:</strong></p><p><br></p><ul><li><strong>motivační dopis v českém a anglickém jazyce,</strong></li><li><strong>profesní životopis s přehledem dosavadní praxe,</strong></li><li><strong>kopie dokladů o dosaženém vzdělání</strong></li></ul><p><strong>Přihlášky a další dokumenty do výběrového řízení v tištěné formě přijímá do 13.12.2023 personální oddělení (Ing. Kateřina Štěpánková) Fakulty podnikatelské VUT v Brně, Kolejní 2906/4, 612 00 Brno.</strong></p><p><strong>The Dean of the Faculty of Business and Management at Brno BUT opens a selection procedure to fill the position of an academic staff member: The Faculty of Business and Management at Brno BUT is currently looking for candidates to fill the position of:</strong></p><p><strong>2 ACADEMIC STAFF MEMBERs – a part-time 0,1 and 0,2 assistant or assistant professor for Department of Economy on a project NPO_VUT_MSMT-16609/2022, Transformation of form and content of education on BUT.</strong></p><p><strong>Job description:</strong></p><p>· Expert activity in education in the field of design and implementation of the course/selected subject;</p><p>· Creation of the content and methodology of the course/subject;</p><p>· Creation of course/subject documentation, including syllabus;</p><p>· Ensuring the teaching of the course/subject, as well as being its supervisor.</p><p><strong>Required Qualifications:</strong></p><p>· A university degree in an appropriate Master''s program;</p><p>· Teaching/lecturing experience is an advantage;</p><p>· Flexibility, independence, responsibility and diligence;</p><p>· An active approach to work and a willingness to learn;</p><p>· Experience in advanced data processing and analysis;</p><p>· English language skills at a level that allows teaching in English and working with specialized English language resources;</p><p>· Commenced or completed PhD studies within the area related to Department of economy.</p><p><strong>We offer:</strong></p><p>• the stability and supportive environment of a public university,</p><p>• a modern workplace offering interesting and creative work,</p><p>• career growth opportunities,</p><p>• flexible working time.</p><p><strong>Expected start date of employment: January 1st, 2024</strong></p><p>Together with your application, also send the following:</p><p>• Czech/English cover letter,</p><p>• CV listing your previous professional experience,</p><p>• Certificate of your highest education (copy is sufficient)</p><p>Applications and other related documents for the selection process, all in printed form, should be delivered by December 13th, 2023 to the Faculty HR Department (Ing. Kateřina Štěpánková) at Brno BUT, Kolejní 2906/4, 612 00 Brno.</p>',
        '2023-11-26 11:07:38.055066', '2023-11-26 11:07:38.055066');
INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('859128b9-9f7e-47cc-998c-2560ffddc1b0', 'ACTIVE', 'Projektový/á manažer/ka', 'Czech Republic',
        'Jihomoravský kraj', 'Brno', 'a3559698-f659-4faf-85b1-fbe69d07d263', 'recruitment.vut@jobportal.application.cz',
        '<p>Kvestorka Vysokého učení technického v Brně vypisuje přijímací řízení na obsazení místa</p><p><strong>Projektový/á manažer/ka</strong></p><p>Na pozici projektového manažera pro projekt Evropské univerzity EULiST hledáme vhodného kandidáta/kandidátku, který má předchozí zkušenosti s komplexním řízením projektů.</p><p><strong>Náplň práce</strong></p><p><br></p><ul><li>Projektové a finanční řízení projektu EULiST;</li><li>Koordinace a metodické řízení projektu;</li><li>Komunikace napříč konsorciem mezinárodních partnerů;</li><li>Administrace a monitoring projektu;</li><li>Zajištění průběžné evaluace projektu;</li><li>Nastavování strategických procesů a postupů na VUT v rámci projektu;</li><li>Aktivní účast na online a fyzických projektových setkáních;</li><li>Komunikace a spolupráce napříč jednotlivými odbory a odděleními Rektorátu VUT (např. ekonomické, personální, právní, studijní, ...);</li><li>Komunikace a spolupráce s fakultami a součástmi VUT;</li><li>Zpracování zpráv a reportů pro poskytovatele (Evropská komise);</li><li>Aktivní zapojení do konkrétních projektových aktivit;</li><li>Zapojení do organizace akcí, které se k projektu přímo vážou;</li><li>Administrace a komunikace v rámci mezinárodních univerzitních sítí na VUT.</li></ul><p><strong>Požadujeme</strong></p><p><br></p><ul><li>Výborná znalost anglického jazyka slovem i písmem;</li><li>Vysokoškolské vzdělání;</li><li>Výborné komunikační a organizační schopnosti;</li><li>Pečlivost a ochota učit se novým věcem;</li><li>Výborná znalost práce MS Office (zejm. Word, Excel, PowerPoint);</li><li>Zkušenost s administrací a řízením projektů na národní a/nebo mezinárodní úrovni ve vysokoškolském prostředí (např. Operační programy, Horizont Evropa, …) výhodou;</li><li>Zkušenost na obdobné pozici výhodou.</li></ul><p><strong>Nabízíme</strong></p><p><br></p><ul><li>Stabilita a zázemí veřejné vysoké školy</li><li>Moderní pracovní prostředí se zajímavou a kreativní prací, přátelský kolektiv</li><li>Doba určitá na rok s možností prodloužení, plný pracovní úvazek</li><li>Pružná pracovní doba</li><li>6 týdnů dovolené</li><li>Další výhody jako stravenkový paušál (nebo stravování v menze s příspěvkem zaměstnavatele), příspěvek na penzijní připojištění, zvýhodněný telefonní tarif atd.</li><li>Jazykové vzdělávání</li></ul><p>Nástup: od 1. 1. 2024 nebo dohodou</p><p><strong>K přihlášce prosím přiložte:</strong></p><p><br></p><ul><li>profesní životopis</li><li>motivačním dopisem v českém a anglickém jazyce</li><li>seznam projektů či projektových schémat, se kterými jste pracoval/a</li><li>kopie dokladů o dosaženém vzdělání</li></ul><p>Přihlášky zasílejte do 07.12.2023 e-mailem, poštou nebo osobním podáním na adresu Personální odbor, Antonínská 548/1, 601 90 Brno.</p>',
        '2023-11-26 11:11:50.433242', '2023-11-26 11:11:50.433242');
INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('bf90b05d-2fb3-4cd4-a212-935c2bd8a343', 'ACTIVE', 'Manažer/manažerka veřejných zakázek', 'Czech Republic',
        'Jihomoravský kraj', 'Brno', 'a3559698-f659-4faf-85b1-fbe69d07d263', 'recruitment.vut@jobportal.application.cz',
        '<p><em>Fakulta elektrotechniky a komunikačních technologií (FEKT) je jednou z největších a nejstarších na Vysokém učení technickém v Brně. V různých studijních programech studuje na fakultě více než tři tisíce studentů, což z nás dělá největší elektrofakultu nejen v České republice, ale i na Slovensku.</em></p><p><em> </em></p><p><em>V rámci studia se věnujeme nejen teorii, ale hlavně praxi v našich moderních laboratořích. Kromě výchovy příští generace odborníků je pro nás důležitý i výzkum. Nejen, že naši vědci pracují na celé řadě celonárodních i mezinárodních projektů, ale řada jejich smluvních výzkumů přinesla praktické výsledky, které bez nadsázky mění svět.</em></p><p><em> </em></p><p><em>Fakulta sídlí v moderních budovách se špičkovým laboratorním vybavením. Provoz a údržba budov, stejně jako rozvoj laboratorního vybavení stojí nemalé prostředky, které jsou většinou získávány z veřejných rozpočtů. Pro uskutečnění nákupů podle legislativních požadavků hledáme nového kolegu či novou kolegyni, který/á nám pomůže s řešením nezbytných kroků spojených s přípravou a realizací veřejných zakázek. Hledáme aktivní a komunikativní osobnost, kterou baví administrativa, vypořádá se se složitými postupy a neostýchá se spolupracovat s akademickými pracovníky.</em></p><p><em> </em></p><p>Děkan Fakulty elektrotechniky a komunikačních technologií Vysokého učení technického v Brně vyhlašuje výběrové řízení na obsazení pracovní pozice <strong>Manažer/ka veřejných zakázek</strong>.</p><p><br></p><p><br></p><h2>Hlavní oblast a činnosti, za které budete spoluodpovědný/á:</h2><ul><li>příprava a administrace zadávacího řízení v souladu se zákonem č. 134/2016 Sb., o zadávání veřejných zakázek a vnitřních předpisů univerzity,</li><li>komunikace s interními žadateli o veřejnou zakázku a poskytování poradenství,</li><li>analýza a návrhy vhodného způsobu zadávání veřejné zakázky pro jednotlivé kategorie nákupu,</li><li>zpracování zadávací dokumentace,</li><li>koordinace jednání komisí pro posouzení a hodnocení nabídek,</li><li>uveřejňování dokumentů prostřednictvím profilu zadavatele,</li><li>uveřejňování smluv v registru,</li><li>archivace dokumentů o veřejné zakázce.</li></ul><p><br></p><p><br></p><h2>Jaká je naše představa o vhodné/m kandidátovi/tce?</h2><ul><li>minimálně středoškolské vzdělání, vysokoškolské vzdělání výhodou,</li><li>výborná znalost zákona o zadávání veřejných zakázek a rozhodovací praxe ÚOHS,</li><li>prokazatelná zkušenost s veřejnými zakázkami alespoň 2 roky,</li><li>dobrá znalost prostředí MS Office (Word, Excel, Outlook),</li><li>dobré komunikační dovednosti a týmová spolupráce,</li><li>aktivní a flexibilní postoj k práci,</li><li>spolehlivost, systematičnost, organizační schopnosti, ochota učit se nové věci.</li></ul><p><br></p><p><br></p><h2>Co může zvýšit šanci na úspěch:</h2><ul><li>zkušenosti, popř. orientace v univerzitním prostředí,</li><li>znalost podmínek zadávání veřejných zakázek z operačních programů.</li></ul><p><br></p><p><br></p><h2>Co získáte, když budete pracovat u nás?</h2><ul><li>zázemí úspěšné, stabilní a prestižní instituce,</li><li>příjemné prostředí a přátelský kolektiv,</li><li>inspirující a dynamické prostředí,</li><li>možnost uplatnit vlastní kreativitu,</li><li>pružnou pracovní dobu,</li><li>podporu dalšího vzdělávání a rozvoje,</li><li>zaměstnanecké benefity (příspěvky na stravu, 6 týdnů dovolené, příspěvek na penzijní připojištění nebo příspěvek na volnočasové aktivity, zvýhodněné volání, částečně flexibilní pracovní dobu a jiné),</li><li>plný pracovní úvazek.</li></ul><p><br></p><p><br></p><h2>K přihlášce přiložte:</h2><ul><li>profesní životopis s přehledem dosavadní praxe,</li><li>motivační dopis.</li></ul><p><br></p><p><strong>Termín pro podání přihlášek je do 28. listopadu 2023.</strong></p><p><br></p><p><strong>Nástup od 1. 1. 2024 nebo dohodou.</strong></p><p><br></p><p><br></p><p>Přihlášku doplněnou o požadované dokumenty zasílejte elektronicky odpovědí na inzerát, kontaktní osoba: Ing. Kateřina Hovořáková, Personální oddělení Fakulty elektrotechniky a komunikačních technologií, Technická 10, 616 00 Brno.</p>',
        '2023-11-26 11:14:31.303789', '2023-11-26 11:14:31.303789');
INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('c37329c0-1cd5-4b8e-89f5-be3a9a0d10e0', 'ACTIVE', 'FAST - Akademický pracovník - asistent / odborný asistent',
        'Czech Republic', 'Jihomoravský kraj', 'Brno', 'a3559698-f659-4faf-85b1-fbe69d07d263',
        'recruitment.vut@jobportal.application.cz',
        '<p><strong>AKADEMICKÝ PRACOVNÍK</strong></p><p>Děkan Fakulty stavební VUT v Brně vypisuje výběrové řízení na obsazení místa akademického pracovníka – asistenta / odborného asistenta pro Ústav stavební ekonomiky a řízení, s úvazkem 1,0.</p><p><strong>Požadavky:</strong></p><p><br></p><ul><li>vysokoškolské vzdělání;</li><li>vědecká hodnost Ph.D. nebo CSc. nebo předpoklady pro její získání;</li><li>výuka předmětů v oblasti rozpočtování, tvorby a kalkulací cen stavebních prací;</li><li>odborné znalosti z managementu stavebnictví, BIM;</li><li>publikační činnost v oboru;</li><li>aktivní znalost angličtiny.</li></ul><p><br></p><p><strong>Nabízíme: </strong></p><p><br></p><ul><li>stabilita a zázemí veřejné vysoké školy,</li><li>příjemné pracovní prostředí se zajímavou a kreativní prací,</li><li>možnost profesního růstu,</li><li>zaměstnanecké benefity (zvýhodněné stravování, penzijní připojištění nebo benefitní karta).</li></ul><p><br></p><p>Úvazek: <strong>1,0 / 40 hod. týdně</strong></p><p>Datum nástupu: <strong> 01.01.2024</strong></p><p>Pracovní poměr: <strong>Doba určitá do 31.12.2024 s možností prodloužení</strong></p><p><br></p><p>Datum vyhlášení: <strong> 06.11.2023</strong></p><p>Uzávěrka přihlášek: <strong>06.12.2023</strong></p><p><br></p><p>Písemné přihlášky doplněné profesním životopisem a kopií dokladu o vzdělání, přijímá zaměstnanecké oddělení děkanátu Fakulty stavební VUT v Brně, Ing. Olga Nešporová, Veveří 95, 602 00 Brno.</p><p><br></p><p><strong>ACADEMIC STAFF </strong></p><p><br></p><p>The dean of the Faculty of Civil Engineering, BUT opens a selection process for 1 position of academic staff – assistant / associate professor for the Institute of Construction Economics and Management, full time job 1,0.</p><p><br></p><p><strong>Requirements:</strong></p><p><br></p><ul><li>University education;</li><li>Ph.D. (or equivalent) or presumption for achievement;</li><li>Teaching of budgeting, price formation and calculation of construction works;</li><li>Professional experiences of construction management, BIM;</li><li>Professional publication activity;</li><li>Active knowledge of English language.</li></ul><p><strong>We offer:</strong></p><p><br></p><ul><li>An interesting job at a prestigious university;</li><li>Pleasant working environment with interesting and creative work;</li><li>Possible professional growth;</li><li>Employee benefits (meal allowance, pension contribution or Edenred card)</li></ul><p>Part-time job: <strong>1,0 / 40 hours per week</strong></p><p>Starting day: <strong>01.01.2024</strong></p><p>Employment: <strong>Temporary contract for 1 year, possible to prolong</strong></p><p><br></p><p>Day of announcement: <strong>06.11.2023</strong></p><p>Deadline of application: <strong>06.12.2023</strong></p><p><br></p><p>Written applications accompanied by a structured CV and copies of the certificates of the highest achieved education shall be submitted to the HR Department of the Dean''s Office of the FCE BUT, to the attention of Olga Nešporová, Veveří 95, 602 00 Brno.</p>',
        '2023-11-26 11:15:46.836627', '2023-11-26 11:15:46.836627');
INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('d233bd5a-4f6e-49c0-8d6d-f71dd11cfeb3', 'ACTIVE', 'Vrátná - Vrátný na Dohodu o provedení práce',
        'Czech Republic', 'Jihomoravský kraj', 'Brno', 'a3559698-f659-4faf-85b1-fbe69d07d263',
        'recruitment.vut@jobportal.application.cz',
        '<p>Stabilní zaměstnavatel VUT v Brně – Fakulta chemická <strong>Přijmeme brigádníka / brigádnici na pozici VRÁTNÝ – VRÁTNÁ na Dohodu o provedení práce, 300 hodin ročně.</strong> Hledáme do svého týmu kolegyni/kolegu, který ke své práci přistoupí pečlivě, svědomitě a s příjemným vystupováním.</p><p>Brigáda je vhodná jako přivýdělek.</p><p>Pracovní doba: směna od 6:00 do 18:00 ve všední dny, pracovní dny, i svátky, dle aktuální potřeby zaměstnavatele.</p><p>Náplní práce je zajištění chodu recepce fakulty s jednoduchou administrativou pro vedení fakulty a ostatní zaměstnance, tj. vedení knihy návštěv a uvádění návštěv, správa došlé a odchozí pošty, komunikace se správou budovy, vydávání a správa klíčů, vizuální monitoring pohybů osob a vozidel.</p><p>Místo výkonu práce: Fakulta chemická, Purkyňova 118, 612 00 Brno. Dobrá dostupnost městskou hromadnou dopravou, parkování v areálu fakulty zdarma.</p><p>Nabízíme práci v moderním prostředí stabilního zaměstnavatele, zaškolení kolegy z provozního oddělení.</p><p>Podrobnější informace Vám rádi obratem sdělíme po zanechání odpovědi na tento inzerát, nebo Vám je zodpovíme na telefonním čísle +420 54114 9452 v době od 8:00 – 16:00.</p><p>Nástup dle dohody</p>',
        '2023-11-26 11:17:35.30913', '2023-11-26 11:17:35.30913');
INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('542425d3-69a3-4fb9-8032-f4441a4c4802', 'ACTIVE', 'Pracovník/pracovnice projektové podpory', 'Czech Republic',
        'Jihomoravský kraj', NULL, 'a3559698-f659-4faf-85b1-fbe69d07d263', 'recruitment.vut@jobportal.application.cz',
        '<p>Kvestorka Vysokého učení technického v Brně vypisuje přijímací řízení na obsazení místa Pracovník/pracovnice projektové podpory (metodika mezinárodních projektů)</p><p><strong> </strong></p><p><strong>Požadavky:</strong></p><p><br></p><ul><li>Středoškolské vzdělání (vysokoškolské vzdělání výhodou)</li><li>Praktické znalosti a zkušenosti v oblasti řízení projektů nebo projektové podpory</li><li>Zkušenosti v oblasti podpory mezinárodních projektů (zejména Horizon Europe, H2020, Creative Europe apod.) výhodou</li><li>Komunikační, organizační a prezentační schopnosti</li><li>Aktivní znalost práce MS Office</li><li>Znalost anglického jazyka na min. úrovni B2</li><li>Znalost vysokoškolského prostředí výhodou</li></ul><p><strong>Náplň práce:</strong></p><p><br></p><ul><li>Projektový monitoring, zajištění projektové podpory pro fakulty a součásti v oblasti mezinárodních projektů</li><li>Příprava metodických materiálů k mezinárodním projektům</li><li>Spolupráce při auditech a kontrolách</li><li>Spolupráce s dalšími členy týmu a součástmi VUT</li></ul><p><br></p><p><strong>Nabízíme:</strong></p><p><br></p><ul><li>Stabilita a zázemí veřejné vysoké školy</li><li>Moderní pracovní prostředí se zajímavou a kreativní prací, přátelský kolektiv</li><li>Doba určitá na rok s možností prodloužení, plný pracovní úvazek</li><li>Pružná pracovní doba</li><li>6 týdnů dovolené</li><li>Další výhody jako stravenkový paušál (nebo stravování v menze s příspěvkem zaměstnavatele), příspěvek na penzijní připojištění, zvýhodněný telefonní tarif atd.</li><li>Jazykové vzdělávání</li></ul><p>Nástup: 01.01.2024 nebo dle dohody</p><p>Přihlášky s profesním životopisem a přiloženým motivačním dopisem včetně kopií dokladů o dosaženém vzdělání zasílejte <strong>do 25. 11. 2023</strong> e-mailem, poštou nebo osobním podáním na adresu Personální odbor, Antonínská 548/1, 601 90 Brno.</p>',
        '2023-11-26 11:18:40.054413', '2023-11-26 11:18:40.054413');
INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('8470c39d-7e65-4445-a530-5136d848a9bb', 'ACTIVE', 'FSI: Ředitel/ka Ústavu automatizace a informatiky',
        'Czech Republic', 'Jihomoravský kraj', 'Brno', 'a3559698-f659-4faf-85b1-fbe69d07d263',
        'recruitment.vut@jobportal.application.cz',
        '<p><span class="ql-cursor">﻿</span>Děkan Fakulty strojního inženýrství Vysokého učení technického v Brně vyhlašuje výběrové řízení na obsazení pozice:</p><p><strong> Ředitel/ředitelka Ústavu automatizace a informatiky</strong></p><p><strong>Kvalifikační požadavky:</strong></p><p><br></p><ul><li>Dosažení vědeckopedagogické hodnosti profesor nebo docent, nebo dlouholeté zkušenosti s řízením obdobného pracoviště, popřípadě předpoklady k zahájení habilitačního řízení do jednoho roku</li><li>Pedagogická a vědecko-výzkumná praxe v délce alespoň 5 let</li><li>Dlouhodobá publikační a tvůrčí činnost v příslušném oboru</li><li>Dobré organizační a komunikační schopnosti</li><li>Schopnost koordinace vědeckých a pedagogických aktivit pracoviště</li></ul><p><strong>Nabízíme:</strong></p><p><br></p><ul><li>Zajímavá tvůrčí práce na akademické půdě špičkové univerzity, vysoce profesionální tým kolegů</li><li>Zaměstnání v instituci, která získala mezinárodní ocenění HR Excellence in Research</li><li>Zvýhodněné stravování</li><li>Příspěvek na penzijní připojištění nebo benefitní karta</li><li>8 týdnů dovolené</li><li>Celoživotní vzdělávání</li><li>Plný úvazek</li></ul><p><strong>Nástup do funkce:</strong> <strong>od 1.ledna 2024</strong> na dvouleté funkční období.</p><p><strong>K přihlášce přiložte:</strong></p><p><br></p><ul><li>Strukturovaný profesní životopis, včetně přehledu vědecko-výzkumné a pedagogické činnosti a seznamu významných publikací a dalších tvůrčích aktivit</li><li>Kopie dokladů o dosaženém vzdělání</li><li>Vize rozvoje příslušného pracoviště zohledňující jeho specifika v oblasti výuky, VaV a spolupráce s průmyslem s výhledem na příští dva roky (max. 5 stran A4)</li></ul><p><strong>Přihlášky spolu s požadovanými přílohami zašlete do 2. 12. 2023 vč</strong>., a to elektronicky odpovědí na inzerát či přímo na níže uvedený e-mail.</p><p><strong>Kontaktní osoba:</strong> Ing. Blanka Skalková, Personální oddělení Fakulty strojního inženýrství VUT v Brně, Technická 2896/2, 616 69 Brno, tel.: +420 541 144 920.</p><p>---------------------------------------------------------------------------------------------------------------------------------------------</p><p>The Dean of the Faculty of Mechanical Engineering of the University of Technology in Brno announces the selection procedure for the position:</p><p><strong>Director of the Institute of Automation and Computer Science</strong></p><p><strong> Qualifying requirements</strong>:</p><p><br></p><ul><li>Achieved title of professor or associate professor, or long experience in the management of a similar department, or the prerequisites to start the habilitation procedure within one year</li><li>Teaching and research experience of at least 5 years</li><li>Long-term publication and creative activity in the relevant field</li><li>Excellent organisational and communication skills</li><li>Ability to coordinate the scientific and teaching activities of the department</li></ul><p><strong>We offer:</strong></p><p><br></p><ul><li>Interesting creative job- within Czech top university and its campus, highly professional team of colleagues</li><li>Work at an institution with HR Excellence in Research Award</li><li>Food allowance (Meal vouchers/Canteen)</li><li>Employer contribution to a pension insurance or benefit card</li><li>8 weeks'' holiday</li><li>Lifelong learning</li><li>Full-time work</li></ul><p><strong> Expected start:</strong> <strong>1th January 2024</strong> for a two-year term.</p><p><strong>Please attach to your application:</strong></p><p><br></p><ul><li>A structured professional curriculum/CV, including a summary of research and teaching activities and a list of major publications and other creative activities</li><li>A copy of evidence of educational qualifications</li><li>A concept of development of the relevant department in the field educational, research and cooperation with industry with a view to the next two years (max. 5 A4 pages)</li></ul><p><strong> Applications with all required documents should be sent by 2 December 2023 incl</strong>., either electronically by replying to the advertisement or directly to the e-mail below.</p><p><strong>Contact person:</strong> Blanka Skalková, Personnel Department, Faculty of Mechanical Engineering, BUT in Brno, Technická 2896/2, 616 69 Brno, tel.: +420 541 144 920.</p>',
        '2023-11-26 11:56:26.976399', '2023-11-26 11:56:26.976399');
INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('945b597f-78f8-4a88-909a-cf69cb389631', 'ACTIVE',
        'Asistent / asistentka na Katedru právní teorie na poloviční pracovní úvazek - obor teorie práva',
        'Czech Republic', 'Jihomoravský kraj', 'Brno', 'f0d33fa5-e460-44b9-8c08-f9029186ec04',
        'masaryk.university@jobportal.application.cz',
        '<p>Děkan Právnické fakulty MU vyhlašuje výběrové řízení na pozici</p><p><strong>asistent / asistentka&nbsp;&nbsp;</strong></p><p>na<strong> Katedru právní teorie</strong></p><p>&nbsp;na poloviční pracovní úvazek: <strong>obor teorie práva</strong></p><p><a href="https://www.muni.cz/" rel="noopener noreferrer" target="_blank">Masarykova univerzita</a>&nbsp;je druhou největší univerzitou v&nbsp;České republice, s&nbsp;10 fakultami, více než 6000 zaměstnanci a&nbsp;více než 30&nbsp;000 studenty.</p><p class="ql-align-justify"><strong>Právnická fakulta</strong> MU je jednou ze čtyř veřejných právnických fakult v&nbsp;České republice. Současnou Právnickou fakultu Masarykovy univerzity je možné charakterizovat jako moderní, dynamickou fakultu, kde v&nbsp;centru zájmu je pedagogická činnost společně s&nbsp;vědeckým bádáním. Jsme institucí, kde termín „výzkumná činnost“ a&nbsp;„vědecká bádání“ nezůstává jen prázdným pojmem. Realizujeme desítky kontaktů se zahraničními odborníky a&nbsp;pedagogicko-vědeckými institucemi jak na individuální, tak na institucionální úrovni a&nbsp;poskytujeme vynikající zázemí pro studenty i&nbsp;zaměstnance. </p><p>Více se o&nbsp;nás můžete dozvědět také na našich webových stránkách <a href="https://www.law.muni.cz/content/cs/" rel="noopener noreferrer" target="_blank">https://www.law.muni.cz/content/cs/</a>, <a href="https://cs-cz.facebook.com/PrfMUni" rel="noopener noreferrer" target="_blank">facebooku</a> nebo na<a href="https://cz.linkedin.com/company/prfmuni" rel="noopener noreferrer" target="_blank"> LinkedIn</a> Právnické fakulty MU.</p><p><strong>Katedra právní teorie</strong> je pracovištěm Právnické fakulty MU, které realizuje činnost vzdělávací a&nbsp;vědecko-výzkumnou v&nbsp;oblasti teorie práva a&nbsp;dalších obecných právních disciplín. V&nbsp;oblasti výuky zajišťuje zejména seznámení se systému současného pozitivního práva, jeho strukturou a&nbsp;základními pojmy jako základem pro studium ostatních teoretických a&nbsp;pozitivně právních disciplín. Přispívá k&nbsp;rozvoji právně-filozofických a&nbsp;metodologických kompetencí studentů fakulty a&nbsp;doplňuje jejich vzdělání o&nbsp;důležitý společenskovědní kontext.</p><p><strong>Náplní Vaší práce bude:</strong></p><p><br></p><ul><li>podíl na teoretické a&nbsp;praktické&nbsp;výuce probíhající na pracovišti,</li><li>příprava studijních a&nbsp;výukových materiálů,</li><li>zapojení do výzkumné činnosti, včetně podílu na publikační činnosti,</li><li>podíl na organizačním zabezpečení výzkumné a&nbsp;pedagogické činnosti, vč. související administrativy.</li></ul><p><strong>Požadujeme:</strong></p><p><br></p><ul><li>ukončené magisterské VŠ vzdělání na právnické fakultě, obor Právo,</li><li>pokročilé stádium doktorského studia,</li><li>zájem o&nbsp;obor teorie práva ověřený konkrétními výsledky,</li><li>pedagogické předpoklady, </li><li>předpoklady pro samostatnou vědecko-výzkumnou činnost,</li><li>schopnost vyučovat a&nbsp;publikovat v&nbsp;českém a&nbsp;anglickém jazyce, další jazykové znalosti jsou výhodou,</li><li>publikační aktivitu v&nbsp;oboru,</li><li>morální bezúhonnost.</li></ul><p><strong>Nabízíme:</strong></p><p><br></p><ul><li>zázemí prestižní a&nbsp;úspěšné instituce,</li><li>motivační a&nbsp;přátelské prostředí,</li><li>podporu profesionálního i&nbsp;osobnostního rozvoje,</li><li>možnost kontinuálního vzdělávání,</li><li>zaměstnanecké benefity (8 týdnů dovolené, příspěvek na penzijní připojištění, stravenkový paušál, výhodné mobilní tarify Vodafone, Multisport karta a&nbsp;další)</li></ul><p><strong>Nástup: od 01.01.2024 </strong>nebo dohodou</p><p><strong>Místo výkonu práce:</strong> Brno</p><p><strong>Typ smlouvy:</strong> na dobu určitou s&nbsp;možností prodloužení</p><p><strong>Termín přihlášek</strong>: <strong>26.11.2023</strong></p><p><strong>Jak se přihlásit:&nbsp;</strong></p><p class="ql-align-justify">Vaši přihlášku zašlete do výše uvedeného termínu-použijte odkaz v&nbsp;sekci Elektronická přihláška (viz níže nebo webové stránky Právnické fakulty – Veřejné informace – Volná místa)</p><p class="ql-align-justify">Vaše přihláška musí obsahovat následující dokumenty:</p><p class="ql-align-justify"><br></p><ul><li>motivační dopis</li><li>strukturovaný životopis</li><li>přehled vědecké a&nbsp;publikační činnosti (pokud je k&nbsp;dispozici)</li><li>fotokopie dokladů o&nbsp;kvalifikaci</li></ul><p class="ql-align-justify">Po úspěšném odeslání Vaší přihlášky obdržíte emailem automatické potvrzení o&nbsp;jejím přijetí.</p><p class="ql-align-justify"><strong>Proces výběru</strong></p><p class="ql-align-justify">Vhodní uchazeči budou zváni na osobní nebo online pohovor. Pravidla pro výběrová řízení univerzity najdete na univerzitních webových stánkách v&nbsp;<a href="https://www.muni.cz/o-univerzite/uredni-deska/rad-vyberoveho-rizeni-mu" rel="noopener noreferrer" target="_blank">Řádu výběrového řízení MU</a>.</p><p class="ql-align-justify"><a href="https://www.muni.cz/o-univerzite/uredni-deska/ochrana-osobnich-udaju" rel="noopener noreferrer" target="_blank">Informace o&nbsp;zpracování a&nbsp;ochraně osobních údajů na MU</a> jsou uvedeny na webové stránce MU.</p><p class="ql-align-justify">Právnická fakulta MU získala cenu Evropské komise HR Excellence in Research za svou politiku lidských zdrojů. Poskytujeme rovné příležitosti, podporujeme diverzitu a&nbsp;snažíme se vytvářet příznivé a&nbsp;uspokojující pracovní prostředí pro zaměstnance.</p><p><br></p>',
        '2023-11-26 13:12:36.203789', '2023-11-26 13:12:36.203789');
INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('332eb685-3b1b-410c-96a9-4838367cd2d2', 'ACTIVE', 'Vedoucí Katedry teorie programování', '', '', '',
        'f0d33fa5-e460-44b9-8c08-f9029186ec04', 'masaryk.university@jobportal.application.cz',
        '<p class="ql-align-center"><strong>Děkan Fakulty informatiky Masarykovy univerzity vyhlašuje výběrové řízení na pozici</strong></p><p class="ql-align-center"><strong>Vedoucí Katedry teorie programování</strong></p><p><strong>Katedra teorie programování</strong> je výukovým a&nbsp;výzkumným pracovištěm Fakulty informatiky MU, informace o&nbsp;vyučovaných předmětech a&nbsp;realizovaných projektech jsou uvedeny <a href="https://www.muni.cz/o-univerzite/fakulty-a-pracoviste/fakulta-informatiky/331100-katteorie-programovani" rel="noopener noreferrer" target="_blank">ZDE</a>. </p><p><strong>Počet otevřených pozic:</strong>&nbsp;1</p><p><strong>Výše úvazku:</strong>&nbsp;40 h/týdně</p><p><strong>EU profil výzkumníka:</strong> R2 – R4</p><p><strong>Pracovní poměr:</strong> na dobu určitou 1 roku, při oboustranné spokojenosti prodloužení do konce funkčního období </p><p><strong>Pracoviště: </strong>Katedra teorie programování, Fakulta informatiky MU, Botanická 68a, 602&nbsp;00 Brno</p><p><strong>Předpokládané datum nástupu:</strong>&nbsp;červen 2024</p><p><strong>Uzávěrka přihlášek:</strong>&nbsp;15.&nbsp;1. 2024</p><p><strong>Hlavní činnosti:</strong></p><p><br></p><ul><li>odpovědnost za pedagogickou a&nbsp;vědeckou činnost katedry a&nbsp;dosahování požadovaných výstupů a&nbsp;výsledků,</li><li>personální řízení katedry (motivace, hodnocení a&nbsp;kariérní růst zaměstnanců),</li><li>spolupráce na zabezpečování výzkumu, vývoje a&nbsp;inovací zejména iniciováním a&nbsp;vedením výzkumných, vývojových nebo inovačních programů nebo projektů,</li><li>odpovědnost za výkon tzv. třetí role univerzity,</li><li>odpovědnost za hospodaření se svěřenými prostředky,</li><li>úzká spolupráce s&nbsp;vedením fakulty,</li><li>vlastní pedagogická, vědecko-výzkumná a&nbsp;publikační činnost.</li></ul><p><strong>Kvalifikační a&nbsp;jiné požadavky (podmínkou):</strong></p><p><br></p><ul><li>akademická nebo vědecká hodnost (profesor, docent, Ph.D., respektive ekvivalent) v&nbsp;oboru informatika nebo příbuzném&nbsp;oboru,</li><li>min. 5 let pedagogické a&nbsp;vědecké praxe v&nbsp;oboru informatika nebo příbuzném oboru, včetně zahraničních aktivit,</li><li>odpovídající&nbsp;publikační a&nbsp;tvůrčí činnost,</li><li>min. 3 roky předchozí praxe v&nbsp;prostředí vysokého školství v&nbsp;České republice,</li><li>předpoklady pro řídící práci a&nbsp;zkušenosti se zahraniční spoluprací a&nbsp;mezinárodními projekty,</li><li>odborné a&nbsp;osobnostní předpoklady pro rozvoj oboru a&nbsp;výzkumu,</li><li>pokročilá znalost akademické češtiny a&nbsp;akademické angličtiny.</li></ul><p><strong>Nabízíme Vám:</strong></p><p><br></p><ul><li>zajímavou práci pro prestižní pracoviště v&nbsp;univerzitním prostředí s&nbsp;mezinárodním přesahem a&nbsp;spoluprací s&nbsp;aplikační sférou,</li><li>kariérní růst a&nbsp;rozvoj (např. univerzitní semináře, kurzy zajišťované MU, účast na konferencích, školení v&nbsp;rámci mobility pracovníků, účast na výzkumných projektech, podpora projektového oddělení),</li><li>zaměstnanecké výhody (8 týdnů dovolené, příspěvek na penzijní připojištění, stravenkový paušál, MultiSport karta, očkování proti chřipce a&nbsp;klíšťové encefalitidě, slevy na jazykové kurzy, výhodné mobilní tarify Vodafone, bezplatný vstup do univerzitních knihoven),</li><li>pracoviště blízko centra Brna s&nbsp;možností bezplatného parkování přímo v&nbsp;areálu fakulty.</li></ul><p><strong>Jak se můžete přihlásit:</strong></p><p class="ql-align-justify">Vaši přihlášku včetně všech požadovaných dokumentů prosím zašlete <strong>do 15.&nbsp;1. 2024</strong> prostřednictvím <strong>elektronické přihlášky</strong> na stránkách MU (viz níže). </p><p>Přihláška musí obsahovat následující <strong>dokumenty</strong>:</p><p><br></p><ul><li>strukturovaný životopis, včetně přehledu pedagogické činnosti, vědecké a&nbsp;publikační činnosti (publikace, které splňují vysoký standard kvality, např. publikace s&nbsp;významným impakt faktorem nebo z&nbsp;renomovaných konferencí, např. s&nbsp;hodnocením alespoň B na portálu CORE),</li><li>kopie dokladu o&nbsp;nejvyšším dosaženém vzdělání (notářské ověření není požadováno; nemusí dokládat interní uchazeči),</li><li>plán rozvoje katedry na následující 4 roky v&nbsp;těchto oblastech: výuka, výzkum, internacionalizace, třetí role katedry, personální řízení.</li></ul><p><strong>Proces výběru</strong>:</p><p>Přihlášku včetně všech požadovaných dokumentů zašlete online prostřednictvím elektronické přihlášky MU (použijte prosím odkaz níže). V&nbsp;případě, že by tento způsob podání nebyl možný, přijímáme i&nbsp;papírovou přihlášku s&nbsp;prohlášením o&nbsp;důvodu takového podání. Výběrová kritéria jsou<strong>&nbsp;</strong>doložení všech požadovaných dokumentů a&nbsp;soulad profilu uchazeče/uchazečky s&nbsp;požadavky na danou pozici. Pravidla pro výběrová řízení Fakulty informatiky naleznete&nbsp;<a href="https://www.fi.muni.cz/staff/selection-procedure/" rel="noopener noreferrer" target="_blank">zde</a>.</p><p>Fakulta informatiky Masarykovy univerzity jako zaměstnavatel poskytuje rovné příležitosti. Podporujeme diverzitu a&nbsp;snažíme se vytvářet pracovní prostředí uspokojující individuální potřeby všech zaměstnanců.&nbsp;Prohlédněte si také&nbsp;<a href="https://www.fi.muni.cz/staff/career/" rel="noopener noreferrer" target="_blank">kariérní stránky naší fakulty</a>.</p><p>Výběrové řízení je založeno na otevřené transparentní politice přijímání zaměstnanců. Fakulta informatiky je držitelem ocenění HR Excellence in Research Award. Pravidla výběrových řízení na Fakultě informatiky MU naleznete na stránce <a href="https://www.fi.muni.cz/staff/selection-procedure/" rel="noopener noreferrer" target="_blank">Výběrové řízení | FI MU (muni.cz)</a>.</p><p>Po úspěšném odeslání přihlášky obdržíte automatický potvrzovací e-mail. Uchazeči, kteří uspějí v&nbsp;prvním kole výběrového řízení, budou pozváni k&nbsp;osobnímu pohovoru nebo videokonferenčnímu pohovoru. Uchazeči, kteří uspějí ve druhém kole, mohou být pozváni k&nbsp;doplňujícímu pohovoru zaměřenému na ověření odborných znalostí a&nbsp;zkušeností s&nbsp;vedením pracovníků.</p><p>V&nbsp;případě nejasností či dotazů spojených s&nbsp;výběrovým řízením prosím kontaktujte personální oddělení FI na&nbsp;<a href="mailto:pers@fi.muni.cz" rel="noopener noreferrer" target="_blank">pers@fi.muni.cz</a>.</p><p>V&nbsp;případě nejasností či dotazů spojených se samotnou pozicí vedoucí/vedoucího katedry prosím kontaktujte děkana Fakulty informatiky prof. RNDr. Jiřího Barnata, Ph.D. na <a href="mailto:dekan@fi.muni.cz" rel="noopener noreferrer" target="_blank">dekan@fi.muni.cz</a>. </p>',
        '2023-11-26 13:16:25.418272', '2023-11-26 13:16:25.418272');
