INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('af957056-3f17-445b-b606-fdff4f3b712f', 'ACTIVE', 'Finanční referent projektu', 'Czech Republic',
        'Jihomoravský kraj', 'Brno', 'a3559698-f659-4faf-85b1-fbe69d07d263', 'vutbr.jobs.cz@jobportal.application.cz',
        '<p>Fakulta chemická VUT v Brně je etablovanou a respektovanou vzdělávací institucí s výraznou výzkumnou činností a silnými vazbami na průmyslovou i další aplikační sféru. Posláním Fakulty chemické je poskytovat kvalitní vzdělání v chemických disciplínách a příbuzných oborech.</p><p>Pro Centrum materiálového výzkumu Fakulty chemické Vysokého učení technického v Brně hledáme</p><p><br></p><h2><strong>Finančního administrátora projektů</strong></h2><p>Rozumíte práci s čísly a tabulkami? Baví Vás práce v programu Excel? Zakládáte si na precizní práci? Láká Vás pracovat v projektovém týmu v univerzitním prostředí? Domluvíte se Anglicky? Potom hledáme právě Vás.</p><p><strong>Náplň práce:</strong></p><p><br></p><ul><li>kontrola čerpání osobních nákladů vědecko-výzkumných projektů</li><li>kontrola čerpání provozních nákladů vědecko-výzkumných projektů</li><li>administrace žádostí o platbu</li><li>příprava podkladů pro žádosti o platbu a případné kontroly projektů</li></ul><p><strong>Požadavky:</strong></p><p><br></p><ul><li>vysokoškolské vzdělání, ekonomický obor výhodou</li><li>praxe v oblasti financování dotačních projektů min. 1</li><li>vynikající znalost práce v programu Excel</li><li>zkušenost s prací v SAP výhodou</li><li>AJ úroveň B2</li></ul><p><strong>Nabízíme:</strong></p><p><br></p><ul><li>práci na plný úvazek, dobu určitou na jeden rok, s předpokladem prodloužení na dobu neurčitou,</li><li>pružnou pracovní dobu,</li><li>6 týdnů dovolené,</li><li>zaměstnanecké benefity (zvýhodněné stravování, příspěvek na penzijní připojištění, benefitní kartu, zvýhodněné volání, možnost homeoffice, fakultní společenské aktivity, atd.),</li><li>stabilní a zajímavou práci v instituci, která získala ocenění HR Excellence in Research,</li><li>příjemnou a přátelskou atmosféru na pracovišti,</li><li>pracovní kulturu, která podporuje udržení životní rovnováhy,</li><li>možnost vzdělávání a dlouhodobého odborného růstu.</li></ul><p>Nástup od 1. prosince 2023, případně podle dohody, možno i ihned. Přijímací řízení bude probíhat vícekolově.</p><p>Bližší informace podá Mgr. Jana Kopřivová, personalistka pro Centrum materiálového výzkumu Fakulty chemické VUT v Brně, Purkyňova 464/118, 612 00 Brno, tel. 54114 9314.</p><p>Jste přesvědčeni, že by Vás tato práce mohla bavit? Pošlete nám přihlášku spolu s profesním životopisem, motivačním dopisem a kopiemi dokladů o dosaženém vzdělání elektronicky přímo přes webové stránky VUT. Těšíme se na Vaši odpověď do 10. listopadu 2023.</p><p>https://www.fch.vut.cz/</p>',
        '2023-11-26 11:57:39.970112', '2023-12-10 11:50:18.514447');
