        'Czech Republic', '', NULL, 'f0d33fa5-e460-44b9-8c08-f9029186ec04',
        'masaryk.university@jobportal.application.cz',
        '<p class="ql-align-center"><strong>Děkan Fakulty informatiky Masarykovy univerzity vyhlašuje výběrové řízení na pozici</strong></p><p class="ql-align-center"><strong>Vedoucí Katedry počítačových systémů a&nbsp;komunikací</strong></p><p><strong>Katedra počítačových systémů a&nbsp;komunikací</strong> je výukovým a&nbsp;výzkumným pracovištěm Fakulty informatiky MU, informace o&nbsp;vyučovaných předmětech a&nbsp;realizovaných projektech jsou uvedeny <a href="https://www.muni.cz/o-univerzite/fakulty-a-pracoviste/fakulta-informatiky/331200-katpocitacovych-systemu-a-komunika/projekty" rel="noopener noreferrer" target="_blank">ZDE</a>. </p><p><strong>Počet otevřených pozic:</strong>&nbsp;1</p><p><strong>Výše úvazku:</strong>&nbsp;40 h/týdně</p><p><strong>EU profil výzkumníka:</strong> R2 – R4</p><p><strong>Pracovní poměr:</strong> na dobu určitou 1 roku, při oboustranné spokojenosti prodloužení do konce funkčního období </p><p><strong>Pracoviště: </strong>Katedra počítačových systémů a&nbsp;komunikací, Fakulta informatiky MU, Botanická 68a, 602&nbsp;00 Brno</p><p><strong>Předpokládané datum nástupu:</strong>&nbsp;červen 2024</p><p><strong>Uzávěrka přihlášek:</strong>&nbsp;15.&nbsp;1. 2024</p><p><strong>Hlavní činnosti:</strong></p><p><br></p><ul><li>odpovědnost za pedagogickou a&nbsp;vědeckou činnost katedry a&nbsp;dosahování požadovaných výstupů a&nbsp;výsledků,</li><li>personální řízení katedry (motivace, hodnocení a&nbsp;kariérní růst zaměstnanců), </li><li>spolupráce na zabezpečování výzkumu, vývoje a&nbsp;inovací zejména iniciováním a&nbsp;vedením výzkumných, vývojových nebo inovačních programů nebo projektů,</li><li>odpovědnost za výkon tzv. třetí role univerzity,</li><li>odpovědnost za hospodaření se svěřenými prostředky,</li><li>úzká spolupráce s&nbsp;vedením fakulty,</li><li>vlastní pedagogická, vědecko-výzkumná a&nbsp;publikační činnost.</li></ul><p><strong>Kvalifikační a&nbsp;jiné požadavky (podmínkou):</strong></p><p><br></p><ul><li>akademická nebo vědecká hodnost (profesor, docent, Ph.D., respektive ekvivalent) v&nbsp;oboru informatika nebo příbuzném&nbsp;oboru,</li><li>min. 5 let pedagogické a&nbsp;vědecké praxe v&nbsp;oboru informatika nebo příbuzném oboru, včetně zahraničních aktivit,</li><li>odpovídající&nbsp;publikační a&nbsp;tvůrčí činnost,</li><li>min. 3 roky předchozí praxe v&nbsp;prostředí vysokého školství v&nbsp;České republice,</li><li>předpoklady pro řídící práci a&nbsp;zkušenosti se zahraniční spoluprací a&nbsp;mezinárodními projekty,</li><li>odborné a&nbsp;osobnostní předpoklady pro rozvoj oboru a&nbsp;výzkumu,</li><li>pokročilá znalost akademické češtiny a&nbsp;akademické angličtiny.</li></ul><p><strong>Nabízíme Vám:</strong></p><p><br></p><ul><li>zajímavou práci pro prestižní pracoviště v&nbsp;univerzitním prostředí s&nbsp;mezinárodním přesahem a&nbsp;spoluprací s&nbsp;aplikační sférou,</li><li>kariérní růst a&nbsp;rozvoj (např. univerzitní semináře, kurzy zajišťované MU, účast na konferencích, školení v&nbsp;rámci mobility pracovníků, účast na výzkumných projektech, podpora projektového oddělení),</li><li>zaměstnanecké výhody (8 týdnů dovolené, příspěvek na penzijní připojištění, stravenkový paušál, MultiSport karta, očkování proti chřipce a&nbsp;klíšťové encefalitidě, slevy na jazykové kurzy, výhodné mobilní tarify Vodafone, bezplatný vstup do univerzitních knihoven),</li><li>pracoviště blízko centra Brna s&nbsp;možností bezplatného parkování přímo v&nbsp;areálu fakulty.</li></ul><p><strong>Jak se můžete přihlásit:</strong></p><p class="ql-align-justify">Vaši přihlášku včetně všech požadovaných dokumentů prosím zašlete <strong>do 15.&nbsp;1. 2024</strong> prostřednictvím <strong>elektronické přihlášky</strong> na stránkách MU (viz níže). </p><p>Přihláška musí obsahovat následující <strong>dokumenty</strong>:</p><p><br></p><ul><li>strukturovaný životopis, včetně přehledu pedagogické činnosti, vědecké a&nbsp;publikační činnosti (publikace, které splňují vysoký standard kvality, např. publikace s&nbsp;významným impakt faktorem nebo z&nbsp;renomovaných konferencí, např. s&nbsp;hodnocením alespoň B na portálu CORE),</li><li>kopie dokladu o&nbsp;nejvyšším dosaženém vzdělání (notářské ověření není požadováno; nemusí dokládat interní uchazeči),</li><li>plán rozvoje katedry na následující 4 roky v&nbsp;těchto oblastech: výuka, výzkum, internacionalizace, třetí role katedry, personální řízení.</li></ul><p><strong>Proces výběru</strong>:</p><p>Přihlášku včetně všech požadovaných dokumentů zašlete online prostřednictvím elektronické přihlášky MU (použijte prosím odkaz níže). V&nbsp;případě, že by tento způsob podání nebyl možný, přijímáme i&nbsp;papírovou přihlášku s&nbsp;prohlášením o&nbsp;důvodu takového podání. Výběrová kritéria jsou<strong>&nbsp;</strong>doložení všech požadovaných dokumentů a&nbsp;soulad profilu uchazeče/uchazečky s&nbsp;požadavky na danou pozici. Pravidla pro výběrová řízení Fakulty informatiky naleznete&nbsp;<a href="https://www.fi.muni.cz/staff/selection-procedure/" rel="noopener noreferrer" target="_blank">zde</a>.</p><p>Fakulta informatiky Masarykovy univerzity jako zaměstnavatel poskytuje rovné příležitosti. Podporujeme diverzitu a&nbsp;snažíme se vytvářet pracovní prostředí uspokojující individuální potřeby všech zaměstnanců.&nbsp;Prohlédněte si také&nbsp;<a href="https://www.fi.muni.cz/staff/career/" rel="noopener noreferrer" target="_blank">kariérní stránky naší fakulty</a>.</p><p>Výběrové řízení je založeno na otevřené transparentní politice přijímání zaměstnanců. Fakulta informatiky je držitelem ocenění HR Excellence in Research Award. Pravidla výběrových řízení na Fakultě informatiky MU naleznete na stránce <a href="https://www.fi.muni.cz/staff/selection-procedure/" rel="noopener noreferrer" target="_blank">Výběrové řízení | FI MU (muni.cz)</a>.</p><p>Po úspěšném odeslání přihlášky obdržíte automatický potvrzovací e-mail. Uchazeči, kteří uspějí v&nbsp;prvním kole výběrového řízení, budou pozváni k&nbsp;osobnímu pohovoru nebo videokonferenčnímu pohovoru. Uchazeči, kteří uspějí ve druhém kole, mohou být pozváni k&nbsp;doplňujícímu pohovoru zaměřenému na ověření odborných znalostí a&nbsp;zkušeností s&nbsp;vedením pracovníků.</p><p>V&nbsp;případě nejasností či dotazů spojených s&nbsp;výběrovým řízením prosím kontaktujte personální oddělení FI na&nbsp;<a href="mailto:pers@fi.muni.cz" rel="noopener noreferrer" target="_blank">pers@fi.muni.cz</a>.</p><p>V&nbsp;případě nejasností či dotazů spojených se samotnou pozicí vedoucí/vedoucího katedry prosím kontaktujte děkana Fakulty informatiky prof. RNDr. Jiřího Barnata, Ph.D. na <a href="mailto:dekan@fi.muni.cz" rel="noopener noreferrer" target="_blank">dekan@fi.muni.cz</a>. </p>',
        '2023-11-26 13:15:01.24613', '2023-11-26 23:24:31.039651');
INSERT INTO public.job_positions (id, status, position_name, country, state, city, company_id, contact_email, detail,
                                  created, last_updated)
VALUES ('fc53243a-1295-4b53-a19a-ebb89d92c177', 'ACTIVE', 'SPECIALIZOVANÝ TECHNICKÝ PRACOVNÍK/TECHNICKÁ PRACOVNICE',
        'Czech Republic', 'Jihomoravský kraj', 'Brno', 'f0d33fa5-e460-44b9-8c08-f9029186ec04',
        'masaryk.university@jobportal.application.cz',
        '<h2>SPECIALIZOVANÝ TECHNICKÝ PRACOVNÍK/TECHNICKÁ PRACOVNICE/</h2><p><strong>Středoevropský technologický institut Masarykovy univerzity (CEITEC MU)</strong></p><p><strong>Brno, Česká republika | www.ceitec.cz</strong></p><p><strong>Jsme vlajkovou lodí základního výzkumu v České republice a jsme součástí Masarykovy univerzity. Naše moderní laboratoře poskytují přístup k nejnovějším technologiím a podporují více než 500 vědců a vědkyň z více než 35 zemí, kteří společně posouvají hranice poznání v oblastech strukturní biologie, molekulární medicíny, genomiky a proteomiky rostlin a neurověd.</strong></p><p><strong>CEITEC MU</strong> je hrdým držitelem ocenění HR Excellence in Research Award, které uděluje Evropská komise a zároveň je první výzkumnou institucí v České republice, která získala jedno z předních míst v soutěži Firma roku: Rovné příležitosti 2020.</p><p><strong>O pozici: </strong></p><p>Vědecká skupina CEITEC hledá do chovného a uživatelského zařízení laboratorních zvířat specializovanou pracovníka/pracovnici na částečný úvazek.</p><p><strong>Co bude Vaše náplň práce? </strong></p><p>Práce zahrnuje manipulaci s laboratorními myšmi, což je týdenní starostlivost o chovnou kolonii, což je přestýlání 1x týdně a napájení 2x týdně.</p><p><strong>Máte (potřebné kompetence):</strong></p><p><br></p><ul><li>Předchozí praktické zkušenosti s práci s laboratorními zvířaty a jejich manipulací (myši).</li><li>Dobrá komunikace a mezilidské dovednosti</li><li>Motivovaný a kolaborativní přístup</li><li>Certifikát výhodou (osvědčení o odborné způsobilosti, na ochranu zvířat proti týrání).</li><li>Středoškolský (minimální) případně bakalářský (výhodou) v oboru biologických nebo veterinárních věd.</li></ul><p><strong>Nabízíme:</strong></p><p><br></p><ul><li>Vhodné pro studenty, matky na mateřské dovolené nebo seniory.</li><li><strong>Práce na 10 h týdně, 2krát měsíčně (dohromady 20 h za měsíc).</strong></li><li>6 týdnů dovolené</li><li>Příspěvek na penzijní připojištění</li><li>Školkovné</li><li>Multisport kartu a zvýhodněné lekce cvičení v kampusu</li><li>Zvýhodněné mobilní tarify</li><li>Možnost využití univerzitního psychologa</li></ul><p><strong>Co dalšího potřebujete vědět:</strong></p><p><strong>Uzávěrka přihlášek: 15.12.2023</strong></p><p>Pohovory: kdykoliv</p><p><strong>Předpokládaný nástup: 1.1.2024</strong></p><p>Úvazek: částečný/brigáda</p><p>Smlouva: na 1 rok</p><p><strong>Přihlášky zahrnující životopis zašlete</strong>&nbsp;<strong>vyplněním e-přihlášky ZDE: https://www.muni.cz/o-univerzite/kariera-na-mu/volna-mista/76918</strong></p><p>V případě problémů s vyplněním e-přihlášky, prosím kontaktujte Anetu Štefanovou.</p><p>Členové výběrové komise jsou: vedoucí vědeckého pracoviště, případně zástupce dané výzkumné skupiny/sdílené laboratoře, zástupce personálního oddělení.</p><p>V odůvodněných případech může vyhlašovatel výběrové řízení prodloužit, přerušit nebo zrušit.</p><p><strong>Stále váháte, zda se přihlásit?</strong></p><p>Vážíme si našich zaměstnanců a podporujeme je od jejich prvního dne na CEITEC MU. Jsme inkluzivní zaměstnavatel podporující rovné příležitosti. Nabízíme mezinárodní pracovní prostředí s prostorem pro spolupráci, kolegialitu a skloubení pracovního a osobního života. Vybraný kandidát se stane součástí vědecké komunity CEITEC, s přístupem k nejmodernějšímu vybavení a s profesionální administrativní podporou. Stanete se součástí mezinárodního týmu odborníků ve svých oborech, kteří společně přispívají ke zlepšování lidského života a zdraví. Podívejte se, co o práci na CEITEC MU říkají Vaši potenciální kolegové.</p><p>Brno je moderní multikulturní město vědy a inovací. Pyšní se druhou nejnižší mírou nezaměstnanosti v celé Evropské unii a je proslulé svou vysokou kvalitou života, ideálními podmínkami pro rodiny, expaty a studenty a krásnou přírodou ve svém okolí. Není divu, že Brno je cílem mnoha odborníků pohybujících se v oblasti vědy a techniky z České republiky i ze světa.</p><p>Více informací o náboru naleznete v CEITEC MU Recruitment Policy.</p><p>Více informací o kariérním systému naleznete v CEITEC MU Kariérní systém.</p><p>Více informací o tom, jak u nás funguje onboarding, naleznete v krátkém videu.</p><p>O pobočce</p><p><br></p><h2>CEITEC MU</h2><p>CEITEC MU je vysokoškolský institut zaměřený na vědy o živé přírodě. Jeho úspěch lze připsat moderním laboratořím i vědcům a vědkyním z celého světa, kteří zlepšují kvalitu života a zdraví. Poskytujeme jim stimulující prostředí s prostorem pro diskuzi a rozvoj nápadů včetně rovných příležitostí.</p>',
        '2023-11-16 11:29:25.64463', '2023-12-10 11:54:15.729155');
