        '<p class="ql-align-center"><strong>Děkan Fakulty informatiky Masarykovy univerzity vyhlašuje výběrové řízení na pozici</strong></p><p class="ql-align-center"><strong>Vedoucí Katedry strojového učení a&nbsp;zpracování dat</strong></p><p><strong>Katedra strojového učení a&nbsp;zpracování dat </strong>je výukovým a&nbsp;výzkumným pracovištěm Fakulty informatiky MU, informace o&nbsp;vyučovaných předmětech a&nbsp;realizovaných projektech jsou uvedeny <a href="https://www.muni.cz/o-univerzite/fakulty-a-pracoviste/fakulta-informatiky/331300-katstrojoveho-uceni-a-zpracovani-d" rel="noopener noreferrer" target="_blank">ZDE</a>. </p><p><strong>Počet otevřených pozic:</strong>&nbsp;1</p><p><strong>Výše úvazku:</strong>&nbsp;40 h/týdně</p><p><strong>EU profil výzkumníka:</strong> R2 – R4</p><p><strong>Pracovní poměr:</strong> na dobu určitou 1 roku, při oboustranné spokojenosti prodloužení do konce funkčního období </p><p><strong>Pracoviště: </strong>Katedra strojového učení a&nbsp;zpracování dat, Fakulta informatiky MU, Botanická 68a, 602&nbsp;00 Brno</p><p><strong>Předpokládané datum nástupu:</strong>&nbsp;červen 2024</p><p><strong>Uzávěrka přihlášek:</strong>&nbsp;15.&nbsp;1. 2024</p><p><strong>Hlavní činnosti:</strong></p><p><br></p><ul><li>odpovědnost za pedagogickou a&nbsp;vědeckou činnost katedry a&nbsp;dosahování požadovaných výstupů a&nbsp;výsledků,</li><li>personální řízení katedry (motivace, hodnocení a&nbsp;kariérní růst zaměstnanců),</li><li>spolupráce na zabezpečování výzkumu, vývoje a&nbsp;inovací zejména iniciováním a&nbsp;vedením výzkumných, vývojových nebo inovačních programů nebo projektů,</li><li>odpovědnost za výkon tzv. třetí role univerzity,</li><li>odpovědnost za hospodaření se svěřenými prostředky,</li><li>úzká spolupráce s&nbsp;vedením fakulty,</li><li>vlastní pedagogická, vědecko-výzkumná a&nbsp;publikační činnost.</li></ul><p><strong>Kvalifikační a&nbsp;jiné požadavky (podmínkou):</strong></p><p><br></p><ul><li>akademická nebo vědecká hodnost (profesor, docent, Ph.D., respektive ekvivalent) v&nbsp;oboru informatika nebo příbuzném&nbsp;oboru,</li><li>min. 5 let pedagogické a&nbsp;vědecké praxe v&nbsp;oboru informatika nebo příbuzném oboru, včetně zahraničních aktivit,</li><li>odpovídající&nbsp;publikační a&nbsp;tvůrčí činnost,</li><li>min. 3 roky předchozí praxe v&nbsp;prostředí vysokého školství v&nbsp;České republice,</li><li>předpoklady pro řídící práci a&nbsp;zkušenosti se zahraniční spoluprací a&nbsp;mezinárodními projekty,</li><li>odborné a&nbsp;osobnostní předpoklady pro rozvoj oboru a&nbsp;výzkumu,</li><li>pokročilá znalost akademické češtiny a&nbsp;akademické angličtiny.</li></ul><p><strong>Nabízíme Vám:</strong></p><p><br></p><ul><li>zajímavou práci pro prestižní pracoviště v&nbsp;univerzitním prostředí s&nbsp;mezinárodním přesahem a&nbsp;spoluprací s&nbsp;aplikační sférou,</li><li>kariérní růst a&nbsp;rozvoj (např. univerzitní semináře, kurzy zajišťované MU, účast na konferencích, školení v&nbsp;rámci mobility pracovníků, účast na výzkumných projektech, podpora projektového oddělení),</li><li>zaměstnanecké výhody (8 týdnů dovolené, příspěvek na penzijní připojištění, stravenkový paušál, MultiSport karta, očkování proti chřipce a&nbsp;klíšťové encefalitidě, slevy na jazykové kurzy, výhodné mobilní tarify Vodafone, bezplatný vstup do univerzitních knihoven),</li><li>pracoviště blízko centra Brna s&nbsp;možností bezplatného parkování přímo v&nbsp;areálu fakulty.</li></ul><p><strong>Jak se můžete přihlásit:</strong></p><p class="ql-align-justify">Vaši přihlášku včetně všech požadovaných dokumentů prosím zašlete <strong>do 15.&nbsp;1. 2024</strong> prostřednictvím <strong>elektronické přihlášky</strong> na stránkách MU (viz níže). </p><p>Přihláška musí obsahovat následující <strong>dokumenty</strong>:</p><p><br></p><ul><li>strukturovaný životopis, včetně přehledu pedagogické činnosti, vědecké a&nbsp;publikační činnosti (publikace, které splňují vysoký standard kvality, např. publikace s&nbsp;významným impakt faktorem nebo z&nbsp;renomovaných konferencí, např. s&nbsp;hodnocením alespoň B na portálu CORE),</li><li>kopie dokladu o&nbsp;nejvyšším dosaženém vzdělání (notářské ověření není požadováno; nemusí dokládat interní uchazeči),</li><li>plán rozvoje katedry na následující 4 roky v&nbsp;těchto oblastech: výuka, výzkum, internacionalizace, třetí role katedry, personální řízení.</li></ul><p><strong>Proces výběru</strong>:</p><p>Přihlášku včetně všech požadovaných dokumentů zašlete online prostřednictvím elektronické přihlášky MU (použijte prosím odkaz níže). V&nbsp;případě, že by tento způsob podání nebyl možný, přijímáme i&nbsp;papírovou přihlášku s&nbsp;prohlášením o&nbsp;důvodu takového podání. Výběrová kritéria jsou<strong>&nbsp;</strong>doložení všech požadovaných dokumentů a&nbsp;soulad profilu uchazeče/uchazečky s&nbsp;požadavky na danou pozici. Pravidla pro výběrová řízení Fakulty informatiky naleznete&nbsp;<a href="https://www.fi.muni.cz/staff/selection-procedure/" rel="noopener noreferrer" target="_blank">zde</a>.</p><p>Fakulta informatiky Masarykovy univerzity jako zaměstnavatel poskytuje rovné příležitosti. Podporujeme diverzitu a&nbsp;snažíme se vytvářet pracovní prostředí uspokojující individuální potřeby všech zaměstnanců.&nbsp;Prohlédněte si také&nbsp;<a href="https://www.fi.muni.cz/staff/career/" rel="noopener noreferrer" target="_blank">kariérní stránky naší fakulty</a>.</p><p>Výběrové řízení je založeno na otevřené transparentní politice přijímání zaměstnanců. Fakulta informatiky je držitelem ocenění HR Excellence in Research Award. Pravidla výběrových řízení na Fakultě informatiky MU naleznete na stránce <a href="https://www.fi.muni.cz/staff/selection-procedure/" rel="noopener noreferrer" target="_blank">Výběrové řízení | FI MU (muni.cz)</a>.</p><p>Po úspěšném odeslání přihlášky obdržíte automatický potvrzovací e-mail. Uchazeči, kteří uspějí v&nbsp;prvním kole výběrového řízení, budou pozváni k&nbsp;osobnímu pohovoru nebo videokonferenčnímu pohovoru. Uchazeči, kteří uspějí ve druhém kole, mohou být pozváni k&nbsp;doplňujícímu pohovoru zaměřenému na ověření odborných znalostí a&nbsp;zkušeností s&nbsp;vedením pracovníků.</p><p>V&nbsp;případě nejasností či dotazů spojených s&nbsp;výběrovým řízením prosím kontaktujte personální oddělení FI na&nbsp;<a href="mailto:pers@fi.muni.cz" rel="noopener noreferrer" target="_blank">pers@fi.muni.cz</a>.</p><p>V&nbsp;případě nejasností či dotazů spojených se samotnou pozicí vedoucí/vedoucího katedry prosím kontaktujte děkana Fakulty informatiky prof. RNDr. Jiřího Barnata, Ph.D. na <a href="mailto:dekan@fi.muni.cz" rel="noopener noreferrer" target="_blank">dekan@fi.muni.cz</a>. </p>',
        '2023-11-26 13:15:48.528289', '2023-12-10 11:54:44.956884');
